import './home.css';

export default function Home() {
  return (
    <div className="home">
      <img src="/public/rec.jpeg" />
      <div className="htitle">
        <h1>Welcome to Cloud Service Recommendation</h1>
      </div>
      <div className="hcon">
        <h3>Fill this form to get your recommendations</h3>
      </div>
    </div>
  )
}
